  false,\n\t\"url\": null,\n\t\"notes\": \"This part of DS 781 presents data for 2-m
  and 5-m bathymetry and shaded-relief maps of Offshore of Monterey map area, California.
  The raster data file is included in \"BathymetryHS_5m_OffshoreMonterey.zip,\" which
  is accessible from http://dx.doi.org/10.5066/F7F47M6T. The 2-m and 5-m bathymetry
  and shaded-relief maps of Offshore of Monterey map area, California, was generated
  from acoustic bathymetry data collected by California State University, Monterey
  Bay (CSUMB) and by Monterey Bay Aquarium Research Institute (MBARI), as well as
  from bathymetric lidar data collected by the U.S. Army Corps of Engineers, Joint
  Airborne Lidar Bathymetry Center of Expertise (JALBTCX). Acoustic mapping was completed
  between 1998 and 2012 using a combination of 200-kHz/400-kHz Reson 7125, 100-kHz
  Reson 7111, 240-kHz Reson 8101, and 30-kHz Simrad EM-300 multibeam echosounders,
  as well as 234-kHz and 468-kHz SWATHplus bathymetric sidescan-sonar systems. Bathymetric
  lidar mapping was completed between 2009 and 2010 for the California Coastal Mapping
  Project (CCMP). These mapping missions combined to collect bathymetry data from
  the shoreline to beyond the limit of Californiau00e2u0080u0099s State Waters. NOTE:
  The horizontal datum of this bathymetry data (NAD83) differs from the horizontal
  datum of other layers in this data release (WGS84).\",\n\t\"license_title\": null,\n\t\"extras\":
